const Testimonial = props => {
  const { heading, paragraph, image } = props;
  return (
    <section className='testimonial'>
      <h1>{heading}</h1>
      <div>
        <img src={image}></img>
        <p>{paragraph}</p>
      </div>
    </section>
  );
};

export default Testimonial;
